import React from 'react'
import { Link } from 'react-router-dom'
import outreach from '../assets/outreach.png'
import writing from '../assets/writing.png'
import research from '../assets/research.png'


const writingClass = {
  backgroundImage: `url(${writing})`,
  height: '500px',
}
const outreacClass = {
  backgroundImage: `url(${outreach})`
}
const researcClass = {
  backgroundImage: `url(${research})`
}


export default function WhatIDo() {

  const iDoArr = ['writing', 'research', 'outreach']
  const iDo = iDoArr.map(thing => {
    return (
      <section classMName={writingClass}>
        <img src={writing} alt=""/>
        <div>
          <h3>{thing}</h3>
          <Link to='/writing'>
            <button>Go to</button>
          </Link>
        </div>
      </section>
    )
  })

  return (
    <div>
      {iDo}
    </div>
  )
}
